import React, { useEffect, useState } from "react";
import { useDrop } from "react-dnd";
import { addTeamToAlliance } from "../helpers/functionallity/teamAlliance";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemText from "@mui/material/ListItemText";
import ListItemAvatar from "@mui/material/ListItemAvatar";
import Avatar from "@mui/material/Avatar";
import { getTeamBelongToThisAlliance } from "../helpers/Api/helperApis.js";
import { useDispatch } from "react-redux";

function Alliance(props) {
  const dispatch = useDispatch();

  const [drop] = useDrop(() => ({
    accept: "team",
    drop: (item) => {
      dispatch(addTeamToAlliance(item.team, props.alliance));
    },
  }));

  return (
    <List
      className="alliance"
      ref={drop}
    
    >
      {[].map((team) => {
        return (
          <ListItem alignItems="flex-start" key={props.alliance.id}>
            <ListItemAvatar>
              <Avatar alt={team.Name[0]} src="/static/images/avatar/1.jpg" />
            </ListItemAvatar>
            <ListItemText primary={team.Name} />
          </ListItem>
        );
      })}
    </List>
  );
}

export default Alliance;
